script: |
  super -f text -I q5246.spq | sort > q5246.out

inputs:
  - name: q5246.spq
    data: |
      SELECT ALL - 73 FROM tab0 (FORMAT parquet) AS cor0 WHERE col2 - 66 BETWEEN 61 + - 68 * - col1 * - col1 + - col1 - + col2 AND - col0 + + 98;
  - name: tab0

outputs:
  - name: q5246.out
    data: |
      -73
      -73
